	/*///------------------------------------------------------------------------
	
	
	/*///------------------------------------------------------------------------
			>>> SPLIT STRING INTO AN ARRAY OF CHARACTERS
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION MB_STR_SPLIT
	(
			string $string	// STRING TO BE PROCESSED
	): ARRAY
	{
		return preg_split ( '/(?<!^)(?!$)/u', $string );
	}
	
	/*///------------------------------------------------------------------------
			>>> LIMIT EACH WORD IN STRING TO NUMBER OF PIXELS
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION PX_PER_WORD
	(
			string $string,					// STRING TO BE PROCESSED
			float $pxlimit,					// NUMBER OF PIXELS
			float $fontsize = 16,			// FONT SIZE USED
			float $boldOffset = 1,			// CHARACTERS ARE BOLD?
			string $separator = '<br/>',	// STRING SEPARATOR
			bool $countSpaces = false		// COUNT SPACE
	)
	{
		if ( $string == '' ) return $string;
		$result = '';
		$multiplier = $fontsize / 16;
		$charsize =
		[
			4		=> 'il',
			4.5		=> 'j.',
			5		=> 'f',
			5.5		=> 'tI',
			6		=> 'rJ!',
			7		=> 'csz',
			8		=> 'aekovxyFLP0123456789',
			9		=> 'bdghnpquETY',
			9.5		=> 'ABKRSVXZ',
			10		=> 'CHNU',
			10.5	=> 'DGOQ',
			12		=> 'wM',
			14		=> 'mW'
		];
		
		$pxlen = 0;
		
		foreach ( explode ( ' ', $string ) as $word )
		{
			foreach ( SELF::MB_STR_SPLIT ( $word ) as $char )
			{
				$px = ( 16 + $boldOffset ) * $multiplier;
				
				if ( mb_detect_encoding ( $char ) != 'UTF-8' )
				{
					$px = ( 14 + $boldOffset ) * $multiplier;
					
					if ( ctype_lower ( $char ) )
					{
						$px = ( 10 + $boldOffset ) * $multiplier;
					}
					
					foreach ( $charsize as $size => $charlist )
					{
						if ( $char != '' && strpos ( $charlist, $char ) !== false )
						{
							$px = ( $size + $boldOffset ) * $multiplier;
							break;
						}
					}
				}
				
				if ( $pxlen >= $pxlimit )
				{
					$pxlen = 0;
					$result .= $separator;
				}
				
				$pxlen += $px;
				$result .= $char;
			}
			
			$result .= ' ';
			$pxlen = $countSpaces ? $pxlen + ( ( 10 + $boldOffset ) * $multiplier ) : 0;
		}
		
		return trim ( $result );
	}
	
	/*///------------------------------------------------------------------------
			>>> SHORTEN THE GIVEN STRING
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SHORTEN_STRING
	(
			string $string,		// STRING TO BE PROCESSED
			int $maxlength,		// LENGTH OF STRING NEEDED
			int $start = 0		// STARTING INDEX
	): STRING
	{
		// GET THE STRING'S CHARACTER ENCODING
		$encoding = mb_detect_encoding($string);
		
		// MEASURE THE LENGTH RELATIVE TO CHARACTER ENCODING
		if ( mb_strlen ( $string, $encoding ) > $maxlength )
		{
			// GET THE REQUIRED STRING
			$string = mb_substr ( $string, $start, $maxlength, $encoding );
		}
		
		// RETURN THE PROCESSED STRING
		return $string;
	}
	
	/*///------------------------------------------------------------------------
			>>> RETURN THE CONTENT OF ARRAY
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION ARRAY_KEY
	(
			array $array,		// ARRAY TO BE PROCESSED
			string $array_key,	// ARRAY INDEX OR KEY
			$default = NULL		// DEFAULT VALUE TO RETURN IF KEY IS NOT FOUND
	)
	{
		return ( array_key_exists ( $array_key, $array ) ? $array[$array_key] : $default );
	}
	
	/*///------------------------------------------------------------------------
			>>> RETURN MULTIPLE CONTENTS FROM ARRAY
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION ARRAY_KEY_ARRAY
	(
			array $array,		// ARRAY TO BE READ
			string $array_keys,	// ARRAY INDEX OR KEY
			$default = NULL		// DEFAULT VALUE TO RETURN IF KEY IS NOT FOUND
	)
	{
		// PREPARE RESULT
		$result = [];
		
		// EXTRACT DATA FROM REQUEST
		foreach ( SELF::DISASSEMBLE( $array_keys ) as $array_key )
		{
			$result[] = SELF::ARRAY_KEY ( $array, $array_key, $default );
		}
		
		// RETURN RESULT
		return $result;
	}
	
	/*///------------------------------------------------------------------------
			>>> SEPARATE VARIABLES USING CHARACTER AND TRIM SPACES
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION DISASSEMBLE
	(
			string $frame,		// STRING TO PROCESS
			string $joint = ','	// SEPARATE ON THIS CHARACTER/STRING
	): ARRAY
	{
		// PREPARE VARIABLES
		$result = [];
		
		// TRIM THE JOINT FROM BOTH ENDS IF THERE ARE ANY AND THEN SEPARATE
		foreach ( explode( $joint, trim ( trim ( $frame, $joint ) ) ) as $parts )
		{
			// TRIM WHITESPACES OF PARTS
			$result[] = trim($parts);
		}
		
		// RETURN THE RESULT
		return $result;
	}
	
	/*///------------------------------------------------------------------------
			>>> CREATE A STRING OF THE DECLARED STRING OR CHARACTER
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION STRING_OF
	(
			string $string,		// STRING TO PROCESS
			int $repetition = 1	// NUMBER OF TIMES REPETITION
	): STRING
	{
		// PREPARE THE RESULT
		$result = '';
		
		// BEGIN ADDING STRING TO RESULT
		for ($ctr = 1; $ctr <= $repetition; $ctr++)
		{
			$result .= $string;
		}
		
		// RETURN THE FINAL RESULT
		return $result;
	}
	
	/*///------------------------------------------------------------------------
			>>> SPLIT A STRING INTO EITHER AN ARRAY OF STRINGS WITH SPECIFIED
				LENGTH OR RETURN A STRING SEPARATED BY THE STATED SEPARATOR
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SPLIT_BY_LENGTH
	(
			string $string,			// STRING TO PROCESS
			int $length = 1,		// LENGTH PER ELEMENT
			string $separator = '',	// CHARACTER/STRING TO USE AS SEPARATOR
			string $beginning = '',	// OPTIONAL STRING TO INSERT AT THE BEGINNING OF EACH LINE
			string $ending = ''		// OPTIONAL STRING TO INSERT AT THE END OF EACH LINE
	)
	{
		// PREPARE THE RESULTS
		$result = [];
		
		// START LOOPING THROUGH THE STRING USING THE LENGTH SPECIFIED
		for( $step = 0; $step < strlen( $string ); $step+=$length )
		{
			// STORE THE STRING WITH LENGTH "$length" INTO THE RESULT ARRAY
			$result[] = $beginning.substr ( $string, $step, $length ).$ending;
		}
		
		// IF STRING RESULT IS EXPECTED, RETURN AN EMPTY STRING IF RESULT IS EMPTY
		if ( count( $result ) === 0 && $separator !== '' )
		{
			return "";
		}
		
		// IF A SEPARATOR IS NOT SPECIFIED, RETURN AN ARRAY INSTEAD OF A STRING
		if ( $separator == '' )
		{
			return $result;
		}
		
		// RETURN A STRING BY DEFAULT
		return implode($separator, $result);
	}
	
	/*///------------------------------------------------------------------------
			>>> LOOP THROUGH ARRAY RECURSIVELY AND PERFORM FUNCTION
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION ARRAY_RECURSIVE_LOOP
	(
			array $array,				// ARRAY TO PROCESS
			closure $function = NULL	// ANONYMOUS FUNCTION
	)
	{
		// PREPARE RETURN VALUE
		$return = SELF::ERROR;
		
		// SET ANONYMOUS FUNCTION TO DEFAULT IF EMPTY
		if ( $function == NULL ) $function = SELF::$HANDLE_FILE;
		
		// CHECK IF FUNCTION IS VALID
		if ( SELF::VAR_TYPE ( $function ) == 'CLOSURE' )
		{
			// GET NUMBER OF PARAMETERS
			$mirror = new ReflectionFunction( $function );
			$parameters = $mirror->getNumberOfParameters();
			$requiredParameters = $mirror->getNumberOfRequiredParameters();
			
			// CHECK IF THE NUMBER OF PARAMETERS IS 1 OR MORE
			// AND IF THE REQUIRED PARAMETERS IS LESS THAN 2
			if ( $parameters >= 1 && $requiredParameters <= 2 )
			{
				// BEGIN LOOPING
				foreach ( $array as $name=>$value )
				{
					if ( is_array ($value) )
					{
						// RECURSE IF ARRAY
						$return = SELF::ARRAY_RECURSIVE_LOOP($value, $function);
					}
					else
					{
						// PREPARE THE ARGUMENTS
						$arguments = [$value];
						
						// IF THERE ARE MORE THAN 1 PARAMETERS, ADD THE NAME
						if ( $parameters > 1 ) { $arguments[] = $name; }
						
						// CALL ANONYMOUS FUNCTION
						$return = $function (...$arguments);
					}
				}
			}
			else
			{
				// THROW ERROR MESSAGE AND RETURN FALSE
				SELF::$STATIC['ERROR'] =	'Anonymous function needs to have at least 1 '.
											'parameter [i.e. function($value){...} ]. '.
											'The first two parameters are reserved for $value '.
											'and $name [i.e. function($value, $name){...} ].';
				$return = SELF::ERROR;
			}
		}
		else
		{
			// THROW ERROR MESSAGE AND RETURN FALSE
			SELF::$STATIC['ERROR'] = 'Anonymous function is invalid.';
			$return = SELF::ERROR;
		}
		
		// RETURN TRUE IF SUCCESSFUL
		return $return;
	}
	
	/*///------------------------------------------------------------------------
			>>> CHANGE THE PATH SEPARATOR
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION STANDARD_PATH
	(
			string $path,						// PATH/URL TO FILE
			bool $use_system_separator = false	// USE YOUR OS'S PATH SEPARATOR?
	): STRING
	{
		// CHANGE BACKSLASHES TO FORWARD SLASH
		$path = str_replace('\\', '/', $path);
		
		if ($use_system_separator)
		{
			// CHANGE FORWARD SLASH TO THE SYSTEM'S PATH SEPARATOR
			$path = str_replace('/', PATH_SEPARATOR, $path);
		}
		
		// RETURN THE NEW PATH
		return $path;
	}
	
	/*///------------------------------------------------------------------------
			>>> STRIP HTTP/S
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION STRIP_HTTP
	(
			string $path // PATH/URL TO FILE
	): STRING
	{
		// RETURN THE NEW PATH
		return str_ireplace ( 'https://', '', str_ireplace ( 'http://', '', $path ) );
	}
	
	/*///------------------------------------------------------------------------
			>>> GET THE FOLDER PATH OF THE CURRENT SCRIPT
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION PATH(): STRING
	{
		// REMOVE SLASHES OF HOST
		$path = trim( "http://{$_SERVER['SERVER_NAME']}", '/' );
		
		// REMOVE SLASHES WHILE URL-ENCODING PER FOLDER
		foreach ( SELF::DISASSEMBLE ( dirname( $_SERVER['PHP_SELF'] ), '/' ) as $folder )
		{
			$path .= "/".rawurlencode ( trim ( $folder, '/' ) );
		}
		
		// MAKE SURE THAT THE PATH ENDS WITH A TRAILING SLASH AND THEN RETURN THE RESULT
		return trim ( $path, "/" )."/";
	}
	
	
	/*///------------------------------------------------------------------------
	-----------------------------------------------------------------------------
*		SYSTEM OPERATIONS
	-----------------------------------------------------------------------------
	/*///------------------------------------------------------------------------
	
	
	/*///------------------------------------------------------------------------
			>>> CHECK THE REQUEST TYPE AND RETURN THE ARRAY KEY REQUESTED
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION REQUEST
	(
			string $array_key,			// ARRAY INDEX OR KEY
			$default = NULL,			// OPTIONAL DEFAULT VALUE TO RETURN
			string $method = 'REQUEST'	// STRICT METHOD CHOICE
	)
	{
		if ( $method == 'REQUEST' || $method == $_SERVER['REQUEST_METHOD'] )
		{
			global ${ $method = "_{$_SERVER['REQUEST_METHOD']}" };
			return ( array_key_exists ( $array_key, $$method ) ? $$method [ $array_key ] : $default );
		}
	}
	
	/*///------------------------------------------------------------------------
			>>> DETECT SSL
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION HTTPS
	(
			string &$url = '',		// OPTIONAL VARIABLE TO STORE HTTPS URL TO
			int $https_port = 443	// OPTIONAL SSL PORT
	): BOOL
	{
		// CREATE HTTPS URL
		$url = "https://".rtrim
		(
			rtrim
			(
				$_SERVER [ 'HTTP_HOST' ], '/'
			), '\\'
		).$_SERVER [ 'REQUEST_URI' ];
		
		// RETURN TRUE IF CURRENT PAGE IS HTTPS
		return
		(
			// CHECK THE SERVER PORT FIRST
			$_SERVER['SERVER_PORT'] == $https_port ||
			// OR CHECK IF HTTPS IS ON
			(
				array_key_exists ( 'HTTPS', $_SERVER ) &&
				!empty ( $_SERVER [ 'HTTPS' ] ) &&
				$_SERVER [ 'HTTPS' ] !== 'off'
			)
		);
	}
	
	/*///------------------------------------------------------------------------
			>>> ENSURE SSL
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SECURE
	(
			int $https_port = 443 // OPTIONAL SSL PORT
	)
	{
		if ( !SELF::HTTPS ( $url, $https_port ) )
		{
			header("location: {$url}");
		}
	}
	
	/*///------------------------------------------------------------------------
			>>> START SESSION IF NOT YET STARTED
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SESSION_BEGIN(): BOOL
	{
		// CHECK IF SESSION IS EMPTY
		if ( session_id() == '' || session_status() == PHP_SESSION_NONE )
		{
			// START A NEW SESSION IF SESSION IS EMPTY
			session_start();
			return true;
		}
		
		return false;
	}
	
	/*///------------------------------------------------------------------------
			>>> DELETE EMPTY OR NON-EMPTY SESSION
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SESSION_DELETE()
	{
		// EMPTY AND DELETE SESSION
		session_unset();
		session_destroy();
	}
	
	/*///------------------------------------------------------------------------
			>>> DELETE EMPTY SESSION
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SESSION_CLEAR(): BOOL
	{
		// CHECK IF SESSION IS EMPTY BEFORE DELETING
		if ( session_id() != '' && empty ( $_SESSION ) )
		{
			SELF::SESSION_DELETE();
			return true;
		}
		
		return false;
	}
	
	/*///------------------------------------------------------------------------
			>>> COMPRESS THE DATA SENT BACK TO CLIENT
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION COMPRESS
	(
			string $array_keys = '',	// COMMA SEPARATED ARRAY INDICES OR KEYS OF $_REQUEST
			bool $mandatory_all = false	// SHOULD ALL KEYS BE PRESENT IN THE REQUEST?
	)
	{
		if
		(
			// NO ARRAY KEYS ARE REQUIRED OR...
				$array_keys == '' ||
				
			// MANDATORY KEYS SHOULD BE FOUND IN THE ARRAY OR...
				( $mandatory_all && SELF::ARRAY_KEYS_EXIST ( $_REQUEST, $array_keys ) ) ||
				
			// SOME KEYS ARE REQUIRED
				( !$mandatory_all && SELF::SOME_ARRAY_KEYS_EXIST ( $_REQUEST, $array_keys ) )
		)
		{
			// CHECK IF THE SERVER ACCEPTS GZIP ENCODING
			if ( substr_count ( $_SERVER["HTTP_ACCEPT_ENCODING"], "gzip" ) )
				ob_start("ob_gzhandler");
		}
	}
	
	
	/*///------------------------------------------------------------------------
	-----------------------------------------------------------------------------
*		FILE OPERATIONS
	-----------------------------------------------------------------------------
	/*///------------------------------------------------------------------------
	
	
	/*///------------------------------------------------------------------------
			>>> CONVERT BYTES TO READABLE SIZE
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION BYTES
	(
			float $size // SIZE IN BYTES
	): STRING
	{ 
		$range = [ ' Bytes', ' KB', ' MB', ' GB', ' TB', ' PB', ' EB', ' ZB', ' YB' ];
		return	$size ? round ( $size / pow ( 1024, ( $index = floor ( log ( $size, 1024 ) ) ) ), 2 ) .
				$range[$index] : '0 Bytes';
	}
	
	/*///------------------------------------------------------------------------
			>>> GET DISK SPACE
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION SPACE
	(
			string $location = '' // FOLDER LOCATION
	): FLOAT
	{
		if ( $location == '' ) $location = getcwd();
		return disk_free_space ( $location );
	}
	
	/*///------------------------------------------------------------------------
			>>> GET DISK INFO
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION DISKS(): ARRAY
	{
		$fso = new COM ( 'Scripting.FileSystemObject' );
		$drives = $fso->Drives;
		$types = [ 'Unknown', 'Removable', 'Fixed', 'Network', 'CD-ROM', 'RAM Disk' ];
		$return = [];
		foreach ( $drives as $drive )
		{
			$driveInfo = $fso->GetDrive ( $drive );
			$letter = $driveInfo->DriveLetter . ":/";
			$name = "[Drive not ready]";
			$type = $types[$driveInfo->DriveType];
			$space = 0;
			$size = 0;
			
			if ( $driveInfo->DriveType == 3 )
			{
				$name = $driveInfo->Sharename;
			}
			else if ( $driveInfo->IsReady )
			{
				$name = $driveInfo->VolumeName;
				$space = $driveInfo->FreeSpace;
				$size = $driveInfo->TotalSize;
			}
			
			$return[] = [
							'letter'=>$letter,
							'name'	=>$name,
							'type'	=>$type,
							'space'	=>$space,
							'size'	=>$size
						];
		}
		
		return $return;
	}
	
	/*///------------------------------------------------------------------------
			>>> GET FOLDER CONTENT
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION FOLDER
	(
			string $dir = '',			// DIRECTORY
			closure $do = NULL,			// ANONYMOUS FUNCTION
			int $start = 1,				// STARTING INDEX
			int $end = 0,				// ENDING INDEX
			bool $showHidden = false,	// SHOW HIDDEN FILES
			bool $showSystem = false,	// SHOW HIDDEN FILES
			bool $countFiles = true		// COUNT NUMBER OF FILES?
	)
	{
		// REMOVE URL ENCODING
		if ( !file_exists ( $dir ) )
		{
			$dirString = rawurldecode ( $dir );
			$dirString = file_exists ( $dirString ) ? $dirString : urldecode ( $dir );
			$dirString = file_exists ( $dirString ) ? $dirString : urldecode ( rawurldecode ( $dir ) );
			$dirString = file_exists ( $dirString ) ? $dirString : rawurldecode ( urldecode ( $dir ) );
			$dir = file_exists ( $dirString ) ? $dirString : $dir;
		}
		
		// PREPARE RETURN ARRAYS (LIST OF FILES IN FOLDER AND LIST OF DATES)
		$return = [];
		$datelist = [];
		
		// INITIALIZE FILE COUNTER
		$index = 0;
		
		// CHECK IF OS IS WINDOWS
		$is_windows = ( strtoupper ( substr ( PHP_OS, 0, 3 ) ) === 'WIN' );
		
		// IF DIRECTORY IS EMPTY, USE THE CURRENT WORKING DIRECTORY BY DEFAULT
		if ( $dir === '' ) $dir = getcwd();
		
		// USE THE DEFAULT METHOD IF NO ANONYMOUS FUNCTION (FOR PROCESSING RETURN ARRAY) IS DECLARED
		if ( $do === NULL ) $do = SELF::$ANON_METHOD;
		
		// IF THE ADDRESS POINTS TO A DIRECTORY
		if ( is_dir ( $dir ) && ( $dh = opendir ( $dir ) ) )
		{
			// ENSURE STANDARD PATH / URL FORMAT
			$dir = rtrim ( SELF::STANDARD_PATH ( realpath ( $dir ) ), '/' ) . '/';
			
			// READ THE DIRECTORY CONTENTS
			while ( ( $file = readdir ( $dh ) ) !== false)
			{
				// IS THE FILE HIDDEN?
				$is_hidden = false;
				
				// IF THE OS IS WINDOWS
				if ( $is_windows )
				{
					// GET THE FILE ATTRIBUTES (CHECK IF FILE IS HIDDEN / SYSTEM)
					$attr = trim ( exec ( 'FOR %A IN ("' . $dir.$file . '") DO @ECHO %~aA' ) );
					$is_hidden = ( $attr[3] === 'h' );
					$is_system = ( $attr[4] === 's' );
				}
				
				// SHOULD THE FILE BE INCLUDED IN THE LIST?
				$show_file = true;
				
				// DO NOT LIST THE FILE IF IT IS HIDDEN/SYSTEM UNLESS FORCED ($showHidden/$showSystem)
				if ( $is_hidden && !$showHidden ) $show_file = false;
				if ( $is_system && !$showSystem ) $show_file = false;
				
				// SHOW THE '..' FOLDER
				if ( $file == '..' ) $show_file = true;
				
				// DO NOT SHOW THE '.' FOLDER
				if ( $file != '.' && $show_file )
				{
					// IF THE FILE IS POINTING TO '..' FOLDER, ADD A TRAILING '/'
					if ( $file == '..' )
					{
						$file = "$file/";
					}
					else
					{
						// IF THE CURRENT FILE IS A NORMAL FILE, COUNT
						$index += 1;
						
						// START LISTING ON '$start'
						if ( $index < $start ) continue;
						
						// END LISTING ON '$end'
						if ( $end > 0 && $index > $end )
						{
							// PROCEED IF COUNT FILES IS ON
							if ( $countFiles )
							{
								continue;
							}
							// STOP HERE IF THERE'S NO NEED TO COUNT THE NUMBER OF FILES
							else
							{
								break;
							}
						}
					}
					
					// INITIALIZE COUNTER TO THE RETURN ARRAYS
					$ctr = 0;
					
					// PREPARE THE FIRST FILE IN THE LIST
					$thisfile = rawurlencode ( $dir.$file );
					
					// READ THE MODIFIED DATE OF THE FIRST FILE IN THE LIST
					$thisFileDateModified = ( $file != '../' ) ? @filemtime ( $dir.$file ) : 0;
					
					// IF PROPERTY IS NOT FOUND, SET DATE TO 1
					if ( $thisFileDateModified === false ) $thisFileDateModified = 1;
					
					// TEMPORARY STORAGE FOR FILE LIST
					$temp = "";
					
					// TEMPORARY STORAGE FOR DATE MODIFIED (IN SECONDS)
					$modtemp = 0;
					
					// ITERATE THROUGH THE LIST OF DATES AND SORT FILE ACCORDING TO DATE
					foreach ( $datelist as $date )
					{
						// SORT BY DATE
						if ( $date < $thisFileDateModified && $date > 0 )
						{
							// TEMPORARILY STORE THE LISTED FILE ADDRESS AND DATE
							$temp = $return [ $ctr ];
							$modtemp = $date;
							
							// REPLACE THE LISTED FILE AND DATE WITH THE FILE HAVING THE LATEST DATE
							$return [ $ctr ] = $thisfile;
							$datelist [ $ctr ] = $thisFileDateModified;
							
							// STORE THE TEMPORARILY LISTED FILE AND DATE
							// TO BE COMPARED TO THE NEXT FILE IN THE LIST
							$thisfile = $temp;
							$thisFileDateModified = $modtemp;
						}
						
						// NEXT FILE IN THE RETURN ARRAY
						$ctr++;
					}
					
					// ADD THE LAST FILE IN THE LIST
					$return[] = $thisfile;
					$datelist[] = $thisFileDateModified;
				}
			}
			
			// CLOSE THE CURRENT DIRECTORY
			closedir ( $dh );
		}
		// IF THE ADDRESS POINTS TO A ZIP FILE
		else if ( is_file ( $dir ) && strtolower ( pathinfo ( $dir, PATHINFO_EXTENSION ) ) == 'zip' )
		{
			// PARSE THE PARENT PATH
			$folder = rtrim ( SELF::STANDARD_PATH ( realpath ( $dir ) ), '/' ) . '/';
			$parent = rtrim ( SELF::STANDARD_PATH ( realpath ( dirname ( $folder ) ) ), '/' ) . '/';
			
			// RETURN THE PARENT PATH AND CURRENT PATH
			$return = [ rawurlencode ( $parent ), $dir ];
		}
		
		// INCLUDE THE FILE COUNT IF INSTRUCTED TO COUNT FILES
		if ( $countFiles ) $return['count'] = $index;
		
		// RETURN THE RESULTS
		return $do ( $return );
	}
	
	/*///------------------------------------------------------------------------
			>>> FIND PROPER PATH TO FILE
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION FILEPATH 
	(
			string $url	// FILE ADDRESS/LOCATION
	)
	{
		$root = $_SERVER['DOCUMENT_ROOT'];
		$host =	( strpos ( $url, '/' ) !== false ) ? explode ( '/', SELF::STRIP_HTTP ( $url ) ) [0] : '';
		return	file_exists ( $url ) ? $url : (
				file_exists ( $new_url = SELF::STRIP_HTTP (str_ireplace($host, $root, $url)) )
				? $new_url : ( file_exists ( $new_url = "/$url" )
				? $new_url : ( file_exists ( $new_url = "$root/$url" )
				? $new_url : $url ) ) );
	}
	
	/*///------------------------------------------------------------------------
			>>> DECODE URLENCODED STRING
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION FILENAME_DECODE
	(
			string $filename	// FILE NAME/LOCATION
	): STRING
	{
		// STORE FILENAME TEMPORARILY
		$fn = $filename;
		
		// TEST THE PROPER ENCODING FOR THE FILENAME STRING
		$filename = is_file ( $filename ) ? $filename : rawurldecode ($fn);
		$filename = is_file ( $filename ) ? $filename : urldecode ( $fn );
		$filename = is_file ( $filename ) ? $filename : rawurldecode ( urldecode ( $fn ) );
		$filename = is_file ( $filename ) ? $filename : urldecode ( rawurldecode ( $fn ) );
		
		// RETURN DECODED FILENAME
		return $filename;
	}
	
	/*///------------------------------------------------------------------------
			>>> GET INFORMATION ABOUT THE FILE PATH/URL
	/*///------------------------------------------------------------------------
	FINAL PUBLIC STATIC FUNCTION LOCATION_INFO
	(
			string &$filename,		// FILE NAME/LOCATION
			string &$mimetype = '',	// FILE MIMETYPE
			string &$extension = ''	// FILE EXTENSION
	): ARRAY
	{
		// DECODE URLENCODED FILENAME
		$filename = SELF::FILENAME_DECODE ( $filename );
		
		// GET MIMETYPE
		$mimetype = is_file ( $filename ) ?
					(
						( $mimetype != '' ) ?
						$mimetype : strtolower ( mime_content_type ( $filename ) )
					) : '';
		
		// GET EXTENSION
		$extension =	( $extension != '' ) ?
						$extension : strtolower ( pathinfo ( $filename, PATHINFO_EXTENSION ) );
		
		// RETURN COLLECTED INFORMATION
		return	[
					'filename' => $filename,
					'mimetype' => $mimetype,
					'extension' => $extension
				];
	}
	
